Renault is similar to:
 the Toyota Prius, with a 2.0-liter turbocharged four-cylinder engine paired with a 6.2-liter V-6 engine. It can be found in the Infiniti QX60, the Lexus RC F and the Lexus RX450h.

The Renault is available with two different engine configurations:

A version with a 6.2-liter V-6 engine, with turbocharger, fuel injection, and two electric motors;

A version with a 2.0-liter turbocharged four-cylinder engine, with turbocharger, fuel injection, and two electric motors;

A version with a 2.0-liter turbocharged four-cylinder engine, with turbocharger, fuel injection, and two electric motors;

The Renault is available with either manual or automatic transmission. A manual transmission is available with the option of a single-clutch transmission and a manual transmission with automatic transmission.

The Renault is available with an optional rear wing, which is similar to the Mercedes-Benz AMG Coupé.

The Renault is available in Europe in two versions:

A 2.0-liter turbocharged four-cylinder engine, with turbocharger, fuel injection, and two electric motors;

A 2.0-liter turbocharged four-cylinder engine, with turbocharger, fuel injection, and two electric motors;

